import React from 'react';
import bunnycloud from './assets/bunnycloud.png';

const Gallery = () => {
    return (
      <div className="gallery-container">
        <h2>Gallery</h2>
        <p>Showcasing the best of Forest Kids art.</p>

        {/* Display the image */}
        <div className="image-container">
          <img src={bunnycloud} alt="Bunny Cloud" className="gallery-image" />
        </div>
      </div>
    );
  }

export default Gallery;
